=head1 DESCRIPTION

Represents list a map of dates with a count of total findings generated
on each date.

=head1 ATTRIBUTES


=head2 Date => Str

The timestamp when the total findings count is observed.

For example, C<Date> would look like C<"2024-09-05T17:00:00-07:00">
whereas C<LastGeneratedAt> would look like 2024-09-05T17:12:29-07:00".


=head2 LastGeneratedAt => Str

The timestamp at which the last finding in the findings count, was
generated.


=head2 Severity => Num

The severity of the findings generated on each date.


=head2 TotalFindings => Int

The total number of findings that were generated per severity level on
each date.



